T = readtable('Data_August_Renewable.csv');
T = rmmissing(T) %[output:58aa5828]

% Create a lifting scheme using the 'haar' wavelet
lScheme = liftingScheme('Wavelet', 'haar');

% [ca cd] = dwt(speedData, 'haar')

% Perform the lifting wavelet transform at level 2
speedData = table2array(T(:, "Speed")); % Convert the "Speed" column to a list of doubles
[ca, cd] = lwt(speedData, 'LiftingScheme', lScheme, 'Level', 2);

% Display approximation and detail coefficients
disp('Approximation Coefficients:'); %[output:4c076151]
disp(ca); %[output:0a637e88]
% 
% disp('Detail Coefficients:');
% disp(cd{1});


% Reconstruct the signal from wavelet coefficients
x_rec = ilwt(ca, cd, 'LiftingScheme', lScheme);

% Plot original and reconstructed signals
figure; %[output:20032c3c]
subplot(2,1,1); %[output:20032c3c]
plot(speedData, 'b-o', 'LineWidth', 1.5); %[output:20032c3c]
title('Original Signal'); %[output:20032c3c]
xlabel('Sample Index'); ylabel('Amplitude'); %[output:20032c3c]

subplot(2,1,2); %[output:20032c3c]
plot(x_rec, 'r-o', 'LineWidth', 1.5); %[output:20032c3c]
title('Reconstructed Signal from LWT'); %[output:20032c3c]
xlabel('Sample Index'); ylabel('Amplitude'); %[output:20032c3c]

% Optional: Compare error
disp('Reconstruction Error:'); %[output:338d6fd6]
disp(norm(speedData - x_rec)); %[output:779ddd9e]

